import {ScrollView, Text,View,StyleSheet} from 'react-native';
import {  Divider } from 'react-native-elements';
import MyPurchasesComp from '../components/MyPurchasesComp';
import { AntDesign } from '@expo/vector-icons'; 
import TotalComp from '../components/TotalComp';
import style from '../style.js';

export default function Mypurchases (){ 

  const [itemsno, setItemsno] = useState(0);
  const [cartItem,setCartItem]=useState([
    {text:'',counter:'1',key:'1'},
    {text:'',counter:'1',key:'2'},
  ])

  return (
    <View>
    <View>

    <ScrollView >

    <View style={styles.container}>
      
    <View style={{flexDirection:'row',justifyContent:'center'}}>
    <Text style={style.Titles} >Shopping Cart</Text>
    <AntDesign name="shoppingcart" size={40} color="gray" />
    </View>

    <View style={styles.header}>
      <View style={styles.itemsno} >
      <Text> {itemsno}</Text>
        <Text> items</Text>
      </View>
        
   </View>

   <Divider style={{backgroundColor:'#dc143c',marginLeft:10,marginRight:10 ,marginBottom:10,}}/>

   <View style={styles.purchases}>
     <MyPurchasesComp/>
     <MyPurchasesComp/>
     <MyPurchasesComp/>
     <MyPurchasesComp/>
     <MyPurchasesComp/>
     <MyPurchasesComp/>
   </View>



  </View>
  
  
</ScrollView>
</View>

<View style={{alignItems:'center'}}>
<TotalComp />
</View>
</View>

  );  
}  

const styles = StyleSheet.create({
  container:{
    margin:20,
    marginTop:25,
    justifyContent:'center',
  },

  itemsno:{
    width:'auto',
    flexDirection:'row',
    marginTop:5,
    justifyContent:'center'
  },

  header:{
    flexDirection:'row',
    justifyContent:'space-between'
  },

  purchases:{
    marginTop:5,
    marginBottom:150,
  },


})
